<script>
KISSY.add('fs-try-like', function (S, Node, IO, XTemplate, Slide) {

    var $ = S.all;

    // 模块初始化函数
    function X(box, module) {

        // code here
        var self = this;
        self.box = $(box);
        self.module = $(module);
        S.ready(function(){
            self._initTry();
            self._initLike();
        })
    }

    S.augment(X, {

        /**
         * 初始化Try模块
         * @private
         */
        _initTry: function () {
            var self = this,
                tpl = self.module.one('.J_Tpl'),
                fsTry = self.module.one('.fs-try'),
                fsTryWrap = self.module.one('.fs-try-wrap');

            function renderBaner(){
                var banner_tpl = '<div class="error-banner"><a href="{{href}}" target="_blank"><img src="{{img}}"></a></div>';
                fsTry.removeClass('g_loading');
                fsTry.html(new XTemplate(banner_tpl).render({img:fsTry.attr('data-img'),href:fsTry.attr('data-href')}));
            }
            new IO({
                url: tpl.attr('data-href'),
                dataType: 'jsonp',
                jsonp: "callback",
                jsonpCallback: "tryInitLocal",
                success: function (data) {
                    var d = data.data;
                    if(d.length==0){
                        renderBaner();
                        return false;
                    }
                    //显示dom
                    fsTry.removeClass('g_loading');
                    fsTryWrap.removeClass('g_hidden');
                    //打乱数据，取随机5个
                    var d = self._deal(d);
                    var slideContainer = self.module.one('.J_TrySlide');
                    slideContainer.html(new XTemplate(tpl.html()).render({result: d}));
                    //init slide
                    var config = {
                        effect: 'hSlide',
                        easing: 'easeInStrong',
                        timeout: 4000,
                        speed: 300,
                        invisibleStop: true,
                        eventType: 'mouseover',
                        triggerDelay: 200,
                        selectedClass: 'current',
                        autoSlide: true,
                        navClass: 'tab-nav',
                        carousel:true
                    };

                    var slide = new Slide(self.module.one('.J_TrySlide'), config);

                    self.module.one('.J_Prev').on('click', function (e) {
                        e.halt();
                        slide.previous();
                    });

                    self.module.one('.J_Next').on('click', function (e) {
                        e.halt();
                        slide.next();
                    });

                },
                error: function () {
                    renderBaner();
                    S.log('试用服务器挂了~~');
                }
            })
        },

        /**
         * 打乱数据
         * @private
         */
        _deal: function (d) {
            function getArrayItems(arr, num) {
                //新建一个数组,将传入的数组复制过来,用于运算,而不要直接操作传入的数组;
                var temp_array = new Array();
                for (var index in arr) {
                    temp_array.push(arr[index]);
                }
                //取出的数值项,保存在此数组
                var return_array = new Array();
                for (var i = 0; i < num; i++) {
                    //判断如果数组还有可以取出的元素,以防下标越界
                    if (temp_array.length > 0) {
                        //在数组中产生一个随机索引
                        var arrIndex = Math.floor(Math.random() * temp_array.length);
                        //将此随机索引的对应的数组元素值复制出来
                        return_array[i] = temp_array[arrIndex];
                        //然后删掉此索引的数组元素,这时候temp_array变为新的数组
                        temp_array.splice(arrIndex, 1);
                    } else {
                        //数组中数据项取完后,退出循环,比如数组本来只有10项,但要求取出20项.
                        break;
                    }
                }
                return return_array;
            }

            //取5个
            return getArrayItems(d, 5);
        },

        /**
         * 获取like相关信息 todo @哲成
         * @private
         */
        _initLike: function () {
            var self = this,
                publish_favor = "//t.taobao.com/cooperate/publish_favor.do?_input_charset=utf-8";
            self._getLikeInfo(function(d){
                S.use('tbc/like/2.0.7/', function (S, Like) {
                    S.each($('.J_UnLike'), function (item) {
                        var itemNode = $(item);
                        new Like({
                            container: itemNode,
                            isDefaultStyle: false,
                            isLiked: false, //你是否爱过
                            triggerTitle: "",
                            triggerHandler: 'J_Tbc_Like_Trigger',
                            counterHandler: 'J_Tbc_Like_Counter',
                            likeText: "喜欢",//只能支持两个字，坑爹！！
                            likeAddress: publish_favor,
                            callback: {
                                liked: function () {
                                    self._voteSuccess(itemNode);
                                },
                                initCount: function () {

                                },
                                likeFail: function () {
                                    S.log('like fail');
                                },
                                likeSuccess: function () {
                                    self._voteSuccess(itemNode);
                                }
                            },
                            counter: {
                                //自定义类型
//                                type: '3',
                                appId: '1113027',
                                subType: '',
                                key:itemNode.attr('data-spuid'),
                                favaorType: ''
                            },
                            comment: '亲, 这个很赞哟~~~！'
                        });
                    })

                });

            });



        },

        /**
         * 获取like相关信息并初始化模板
         * @private
         */
        _getLikeInfo: function (callback) {
            var self = this,
            //需要的地址
                reqUri = '//3c.taobao.com/json/getSPUList.htm';
            //传递的参数
            var likeBox = self.module.one('.J_FsLike');
            var catIds = likeBox.attr('data-catids'),
                spuIds = likeBox.attr('data-spuids');

            IO({
                url: reqUri,
                dataType: 'jsonp',
                jsonp: "callback",
                data:{
                    cat:catIds,
                    spuId:spuIds
                },
                success: function (d) {
                    likeBox.removeClass('g_loading');
                    //初始化模板
                    //init tpl
                    likeBox.html(new XTemplate(self.module.one('.J_LikeTpl').html()).render({result: d.list}));

                    //判断是否登陆
                    if(d.isLogin==false){
                        $('.J_UnLike').html('喜欢').on('click',function(){
                            //弹出mini登陆框
                            S.use('tbc/mini-login/1.4.0/', function(S, ML) {
                                ML.show({}, function() {
                                    window.location.reload();
                                });
                            });
                        });
                    }
                    else{
                        //初始化喜欢组件
                        callback(d);
                    }
                },
                error:function(){
                    var banner_tpl = '<div class="error-banner"><a href="{{href}}" target="_blank"><img src="{{img}}"></a></div>';
                    likeBox.removeClass('g_loading');
                    likeBox.html(new XTemplate(banner_tpl).render({img:likeBox.attr('data-img'),href:likeBox.attr('data-href')}));
                }
            })

        },

        /**
         * 初始化喜欢模板
         * @private
         */
        _renderLikeTpl: function () {

        },

        /**
         * 投票成功
         * @private
         */
        _voteSuccess: function (itemNode) {
            var parentNode = itemNode.parent(3),
                likeBox = parentNode.one('.like-box'),
                voteSuccess = parentNode.one('.vote-success'),
                ifClick = false;
            //3d transform
            likeBox.addClass('flipY-hidden');

            voteSuccess.replaceClass('flipY-hidden', 'flipY-show');

            //bind
            parentNode.one('.vote-close').on('click', function () {
                transform();
                ifClick = true;
            })

            //3s后执行旋转
            setTimeout(function () {
                if (!ifClick) {
                    transform();
                }
            }, 3000);

            function transform() {
                //for no flip browsers
                likeBox.css('z-index', 4);
                //rewrite the like btn info
                try{
                    var count = parseInt(S.trim(itemNode.attr('data-count')))+1;
                }catch(e){
                    var count = 1;
                }

                itemNode.removeClass('unlike').one('.J_Tbc_Like_Trigger').html('已喜欢&nbsp;' + (count > 9999 ? (count / 10000 + 'W') : count));
                //transform

                likeBox.replaceClass('flipY-hidden', 'flipY-show');
                voteSuccess.replaceClass('flipY-show', 'flipY-hidden');
            }

        }
    })

    return X;

}, {
    requires: [
        'node',
        'io',
        'xtemplate',
        'gallery/slide/1.3/index'
    ]
});

/*!YUI-Compressor */
</script>
